import React from 'react';
import './ListItem.css';
import InceptionImage from '../../../assets/images/inception.jpeg';

const ListItem = (props) => (
    <li className="listItem__wrapper">
        <img src={props.image} className="listItem__image"/>
        <div>
            <h2 className="listItem__title">{props.title}</h2>
            <p className="listItem__description">{props.de}</p>
            <button className="listItem__button">visit movie page</button>
        </div>
    </li>
);

export default ListItem;
